import React, { useState, useEffect } from 'react';
import Navbar from '../../components/Common/Navbar';
import LogoutButton from '../../components/Common/LogoutButton';
import UserInfo from '../../components/Common/UserInfo';
import axios from 'axios';
import './RobotEditPage.css'; // CSS 파일 적용

function RobotEditPage() {
  const [robots, setRobots] = useState([]);
  const [selectedRobot, setSelectedRobot] = useState(null);
  const [description, setDescription] = useState('');

  useEffect(() => {
    fetchRobots();
  }, []);

  const fetchRobots = async () => {
    const token = localStorage.getItem('token');

    if (!token) {
      alert('No token found, please log in again.');
      return;
    }

    try {
      const response = await axios.get('http://172.30.1.15:5559/robot/robots', {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });
      setRobots(response.data);

      // 첫 번째 로봇을 기본 선택
      if (response.data.length > 0) {
        setSelectedRobot(response.data[0]);
        setDescription(response.data[0].description); // 첫 로봇의 설명 가져오기
      }
    } catch (error) {
      console.error('Error fetching robots:', error);
    }
  };

  const handleSelectRobot = (robot) => {
    setSelectedRobot(robot);
    setDescription(robot.description); // 선택된 로봇의 설명 설정
  };

  const handleUpdate = async (e) => {
    e.preventDefault();

    const token = localStorage.getItem('token');
    if (!token) {
      alert('No token found, please log in again.');
      return;
    }

    try {
      await axios.put(`http://172.30.1.15:5559/robot/update/${selectedRobot._id}`, {
        description
      }, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });
      alert('Robot updated successfully');
      fetchRobots();
    } catch (error) {
      console.error('Error updating robot:', error);
      alert(`Error updating robot: ${error.response?.data?.message || error.message}`);
    }
  };

  return (
    <div className="robot-edit-page">
      <header className="header">
        <UserInfo />
        <LogoutButton />
      </header>
      <Navbar /> {/* 상단 네비게이션 바 */}
      <div className="main-content">
        <div className="robot-list-container">
          <h3>Your Robots</h3>
          <ul className="robot-list">
            {robots.map((robot) => (
              <li
                key={robot._id}
                onClick={() => handleSelectRobot(robot)}
                className={selectedRobot && selectedRobot._id === robot._id ? 'selected' : ''}
              >
                {robot.name} - {robot.ip}
              </li>
            ))}
          </ul>
        </div>
        <div className="robot-details-container">
          {selectedRobot ? (
            <div>
              <h3>Robot Details</h3>
              <p>Name: {selectedRobot.name}</p>
              <p>IP: {selectedRobot.ip}</p>
              <p>Model: {selectedRobot.model}</p>
              <p>Battery: {selectedRobot.status.battery}%</p>
              <p>Status: {selectedRobot.status.state}</p>
              <form onSubmit={handleUpdate}>
                <label>
                  Description:
                  <textarea
                    value={description}
                    onChange={(e) => setDescription(e.target.value)}
                    placeholder="Enter robot description"
                    rows="4"
                    style={{ width: '100%', marginTop: '10px' }}
                  />
                </label>
                <button type="submit" style={{ marginTop: '10px', padding: '10px 20px', borderRadius: '5px', backgroundColor: '#4CAF50', color: '#fff', border: 'none', cursor: 'pointer' }}>
                  Update Description
                </button>
              </form>
            </div>
          ) : (
            <p>Please select a robot to view details</p>
          )}
        </div>
      </div>
    </div>
  );
}

export default RobotEditPage;
